import '.Header'
function Header(){
    return(
        <div>
            <ul>
                <li><a href="#active">Active Listining</a></li>
                <li><a href="#create">Create</a></li>
                <li><a href="#category">Category</a></li>
                <li><a href="#watchlist">Watch List</a></li>
            </ul>
        </div>
    )
}
export default Header;
